PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE ChildRelationship (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    PersonID INTEGER NOT NULL,
    RelationshipID INTEGER NOT NULL,
    Nature1 INT NOT NULL DEFAULT 0,
    Nature2 INT NOT NULL DEFAULT 0,
    ChildOrder INT NOT NULL DEFAULT 0,
    Private BOOLEAN NOT NULL DEFAULT 0,
    Preferred BOOLEAN NOT NULL,
    CreateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    UpdateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    SyncVersion INTEGER NOT NULL DEFAULT 0,
    UID TEXT,
    CONSTRAINT CT_ChildRelationship UNIQUE (PersonID, RelationshipID),
    CONSTRAINT FK_ChildRelationship_PersonID FOREIGN KEY(PersonID) REFERENCES Person (ID) ON DELETE CASCADE DEFERRABLE INITIALLY DEFERRED,
    CONSTRAINT FK_ChildRelationship_RelationshipID FOREIGN KEY(RelationshipID) REFERENCES Relationship (ID) ON DELETE CASCADE DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE Deleted (
	ID INTEGER PRIMARY KEY  AUTOINCREMENT,
    ItemID INTEGER NOT NULL,
    TableID INT NOT NULL,
    DeleteDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    SyncVersion INTEGER NOT NULL DEFAULT 0,
    UID TEXT
);
CREATE TABLE Fact (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    LinkID INTEGER NOT NULL,
    LinkTableID INT NOT NULL,
    FactTypeID INTEGER NOT NULL,
    Private BOOLEAN NOT NULL DEFAULT 0,
    Preferred BOOLEAN NOT NULL,
    Date TEXT NULL,
    PlaceID INTEGER NULL,
    Text TEXT NULL,
    MediaLinkedCounts INT NOT NULL DEFAULT 0,
    SourceLinkedCounts INT NOT NULL DEFAULT 0,
    CreateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    UpdateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    Status TEXT NULL,
    DateSort1 INTEGER NULL,
    DateSort2 INTEGER NULL,
    DateModifier1 INT(8) NULL,
    DateModifier2 INT(8) NULL,
    SyncVersion INTEGER NOT NULL DEFAULT 0,
    UID TEXT,
    CONSTRAINT FK_Fact_FactTypeID FOREIGN KEY(FactTypeID) REFERENCES FactType (ID) DEFERRABLE INITIALLY DEFERRED,
    CONSTRAINT FK_Fact_PlaceID FOREIGN KEY(PlaceID) REFERENCES Place (ID) ON DELETE SET DEFAULT DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE FactType (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    Name TEXT NOT NULL,
    ShortName TEXT NULL,
    Abbreviation TEXT NULL,
    FactCategory INT NOT NULL DEFAULT 0,
    FactClass INT NOT NULL,
    Tag TEXT NOT NULL,
    SentenceFormat TEXT NULL,
    CreateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    UpdateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    SyncVersion INTEGER NOT NULL DEFAULT 0,
    UID TEXT
);
CREATE TABLE HistoryList (
    ID INTEGER PRIMARY KEY,
    ObjectID INTEGER NOT NULL,
    ActionTitle TEXT NOT NULL,
    ActionDescription TEXT NOT NULL,
    HistoryDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    ObjectType INT NOT NULL,
    UpdateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    UID TEXT
);
CREATE TABLE MasterSource (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    Title TEXT NOT NULL,
    Author TEXT NULL,
    PublisherName TEXT NULL,
    PublisherLocation TEXT NULL,
    PublishDate TEXT NULL,
    RepositoryID INTEGER NULL,
    CallNumber TEXT NULL,
    Comments TEXT NULL,
    PID TEXT NULL,
    SourceType INT NOT NULL DEFAULT 0,
    TemplateData TEXT NULL,
    CreateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    UpdateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    SyncVersion INTEGER NOT NULL DEFAULT 0,
    UID TEXT,
    CONSTRAINT FK_MasterSource_RepositoryID FOREIGN KEY(RepositoryID) REFERENCES Repository (ID) ON DELETE SET DEFAULT DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE MediaFile (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    FileName TEXT NOT NULL,
    FileCaption TEXT NULL,
    FileDescription TEXT NULL,
    FileDate TEXT NULL,
    Thumbnail BLOB NULL,
    ModifiedTime DATETIME NOT NULL,
    GUID GUID NOT NULL,
    PID TEXT NULL,
    CreateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    UpdateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    IsPrivate BOOLEAN NOT NULL DEFAULT 0,
    SyncVersion INTEGER NOT NULL DEFAULT 0,
    WID INTEGER NULL DEFAULT NULL,
    UID TEXT,
    FileHash TEXT NULL,
    CONSTRAINT FK_Watermark_MediaFileWID FOREIGN KEY (WID) REFERENCES Watermark(ID) DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE MediaFileOriginal (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    MediaFileID INTEGER NOT NULL,
    FileHash TEXT NULL,
    UID TEXT NULL,
    CONSTRAINT FK_MediaFile_Fact FOREIGN KEY (MediaFileID) REFERENCES MediaFile(ID) DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE MediaLink (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    LinkID INTEGER NOT NULL,
    LinkTableID INT NOT NULL,
    MediaFileID INTEGER NOT NULL,
    Private BOOLEAN NOT NULL DEFAULT 0,
    FileOrder INT NOT NULL DEFAULT 0,
    CreateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    UpdateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    SyncVersion INTEGER NOT NULL DEFAULT 0,
    UID TEXT,
    CONSTRAINT CT_MediaLink UNIQUE (LinkID, LinkTableID, MediaFileID),
    CONSTRAINT FK_MediaLink_MediaFileID FOREIGN KEY(MediaFileID) REFERENCES MediaFile (ID) ON DELETE CASCADE DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE Note (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    LinkID INTEGER NOT NULL,
    LinkTableID INT NOT NULL,
    Category TEXT NOT NULL,
    CreateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    ModifyDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    Private BOOLEAN NOT NULL DEFAULT 0,
    NoteText TEXT NULL,
    SyncVersion INTEGER NOT NULL DEFAULT 0,
    UID TEXT,
    CONSTRAINT CT_Note UNIQUE (LinkID, LinkTableID, Category)
);
CREATE TABLE Person (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    PersonGUID GUID NOT NULL,
    Private BOOLEAN NOT NULL DEFAULT 0,
    NameFactID INTEGER NULL,
    Sex TEXT NULL,
    SexFactID INTEGER NULL,
    BirthDate TEXT NULL,
    BirthPlace TEXT NULL,
    BirthPlaceID INTEGER NULL,
    BirthFactID INTEGER NULL,
    DeathDate TEXT NULL,
    DeathPlace TEXT NULL,
    DeathPlaceID INTEGER NULL,
    DeathFactID INTEGER NULL,
    MarriageDate TEXT NULL,
    MarriagePlace TEXT NULL,
    MarriagePlaceID INTEGER NULL,
    MarriageFactID INTEGER NULL,
    PreferredRelID INTEGER NULL,
    PreferredMediaFileID INTEGER NULL,
    MediaLinkedCounts INT NOT NULL DEFAULT 0,
    LinkedCounts INT NOT NULL DEFAULT 0,
    Sequence INT NOT NULL DEFAULT 0,
    CreateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    UpdateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    Title TEXT NULL COLLATE NOCASE,
    GivenName TEXT NULL,
    FamilyName TEXT NULL,
    NameSuffix TEXT NULL,
    FullName TEXT NULL COLLATE NOCASE,
    FullNameReversed TEXT NULL COLLATE NOCASE,
    BirthDateSort1 INTEGER NULL,
    BirthDateSort2 INTEGER NULL,
    BirthDateModifier1 INT(8) NULL,
    BirthDateModifier2 INT(8) NULL,
    BirthDateYear INTEGER NULL,
    DeathDateSort1 INTEGER NULL,
    DeathDateSort2 INTEGER NULL,
    DeathDateModifier1 INT(8) NULL,
    DeathDateModifier2 INT(8) NULL,
    DeathDateYear INTEGER NULL,
    MarriageDateSort1 INTEGER NULL,
    MarriageDateSort2 INTEGER NULL,
    MarriageDateModifier1 INT(8) NULL,
    MarriageDateModifier2 INT(8) NULL,
    MarriageDateYear INTEGER NULL,
    SyncVersion INTEGER NOT NULL DEFAULT 0,
    UID TEXT,
    PreferredMediaFileCrop TEXT NULL,
    CONSTRAINT FK_Person_NameFactID FOREIGN KEY(NameFactID) REFERENCES Fact (ID) ON DELETE SET DEFAULT DEFERRABLE INITIALLY DEFERRED,
    CONSTRAINT FK_Person_SexFactID FOREIGN KEY(SexFactID) REFERENCES Fact (ID) ON DELETE SET DEFAULT DEFERRABLE INITIALLY DEFERRED,
    CONSTRAINT FK_Person_BirthPlaceID FOREIGN KEY(BirthPlaceID) REFERENCES Place (ID) ON DELETE SET DEFAULT DEFERRABLE INITIALLY DEFERRED,
    CONSTRAINT FK_Person_BirthFactID FOREIGN KEY(BirthFactID) REFERENCES Fact (ID) ON DELETE SET DEFAULT DEFERRABLE INITIALLY DEFERRED,
    CONSTRAINT FK_Person_DeathPlaceID FOREIGN KEY(DeathPlaceID) REFERENCES Place (ID) ON DELETE SET DEFAULT DEFERRABLE INITIALLY DEFERRED,
    CONSTRAINT FK_Person_DeathFactID FOREIGN KEY(DeathFactID) REFERENCES Fact (ID) ON DELETE SET DEFAULT DEFERRABLE INITIALLY DEFERRED,
    CONSTRAINT FK_Person_MarriagePlaceID FOREIGN KEY(MarriagePlaceID) REFERENCES Place (ID) ON DELETE SET DEFAULT DEFERRABLE INITIALLY DEFERRED,
    CONSTRAINT FK_Person_MarriageFactID FOREIGN KEY(MarriageFactID) REFERENCES Fact (ID) ON DELETE SET DEFAULT DEFERRABLE INITIALLY DEFERRED,
    CONSTRAINT FK_Person_PreferredRelID FOREIGN KEY(PreferredRelID) REFERENCES Relationship (ID) ON DELETE SET DEFAULT DEFERRABLE INITIALLY DEFERRED,
    CONSTRAINT FK_Person_PreferredMediaFileID FOREIGN KEY(PreferredMediaFileID) REFERENCES MediaFile (ID) ON DELETE SET DEFAULT DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE Place (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    Name TEXT NOT NULL,
    DisplayName TEXT NULL,
    CreateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    UpdateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    SyncVersion INTEGER NOT NULL DEFAULT 0,
    UID TEXT
);
CREATE TABLE Publication (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    Category INT NOT NULL DEFAULT 0,
    Type TEXT NOT NULL,
    Name TEXT NOT NULL,
    Attributes INT NOT NULL DEFAULT 0,
    Context INT NOT NULL DEFAULT 0,
    Size INT NOT NULL,
    Xml TEXT NOT NULL,
    CreateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    ModifyDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    SyncVersion INTEGER NOT NULL DEFAULT 0,
    UID TEXT
);
CREATE TABLE Relationship (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    Person1ID INTEGER NULL,
    Person2ID INTEGER NULL,
    RelType INT NOT NULL DEFAULT 0,
    Status INT NOT NULL DEFAULT 0,
    Nature INT NOT NULL DEFAULT 0,
    Order1 INT NOT NULL DEFAULT 0,
    Order2 INT NOT NULL DEFAULT 0,
    Private BOOLEAN NOT NULL DEFAULT 0,
    CreateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    UpdateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    SyncVersion INTEGER NOT NULL DEFAULT 0,
    UID TEXT,
    CONSTRAINT FK_Relationship_Person1ID FOREIGN KEY(Person1ID) REFERENCES Person (ID) ON DELETE SET DEFAULT DEFERRABLE INITIALLY DEFERRED,
    CONSTRAINT FK_Relationship_Person2ID FOREIGN KEY(Person2ID) REFERENCES Person (ID) ON DELETE SET DEFAULT DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE Repository (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    Name TEXT NOT NULL,
    Contact TEXT NULL,
    Address TEXT NULL,
    Phone TEXT NULL,
    Email TEXT NULL,
    CreateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    UpdateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    SyncVersion INTEGER NOT NULL DEFAULT 0,
    UID TEXT
);
CREATE TABLE Setting (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    Name TEXT NOT NULL,
    StringValue TEXT NULL,
    CreateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    UpdateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    UID TEXT
);
CREATE TABLE Source (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    MasterSourceID INTEGER NULL,
    PageNumber TEXT NULL,
    Comment TEXT NULL,
    IncludeComment INT NOT NULL DEFAULT 0,
    Footnote TEXT NULL,
    Abbreviated TEXT NULL,
    MediaLinkedCounts INT NOT NULL DEFAULT 0,
    PID TEXT NULL,
    CreateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    UpdateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    SyncVersion INTEGER NOT NULL DEFAULT 0,
    UID TEXT,
    CONSTRAINT FK_Source_MasterSourceID FOREIGN KEY(MasterSourceID) REFERENCES MasterSource (ID) ON DELETE SET DEFAULT DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE SourceLink (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    LinkID INTEGER NOT NULL,
    LinkTableID INT NOT NULL,
    SourceID INTEGER NOT NULL,
    IsSource BOOLEAN NOT NULL DEFAULT 0,
    Stars INT NOT NULL DEFAULT 0,
    CalcFlags INT NOT NULL DEFAULT 0,
    Calculated BOOLEAN NOT NULL DEFAULT 0,
    Justification TEXT NULL,
    ExternalID TEXT NULL,
    CreateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    UpdateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    SyncVersion INTEGER NOT NULL DEFAULT 0,
    UID TEXT,
    CONSTRAINT CT_SourceLink UNIQUE (LinkID, LinkTableID, SourceID),
    CONSTRAINT FK_SourceLink_SourceID FOREIGN KEY(SourceID) REFERENCES Source (ID) ON DELETE CASCADE DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE Tag (
    ID INTEGER PRIMARY KEY,
    Name TEXT NOT NULL,
    IsSystem BOOLEAN NOT NULL DEFAULT 0,
    Color INT NULL,
    Emphasize BOOLEAN NOT NULL DEFAULT 0,
    TableID INT NULL,
    CreateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    UpdateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    SyncVersion INTEGER NOT NULL DEFAULT 0,
    UID TEXT
);
CREATE TABLE TagLink (
    ID INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
    TagID INTEGER NOT NULL,
    LinkID INTEGER NOT NULL,
    LinkTableID INT NOT NULL,
    CreateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    UpdateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    SyncVersion INTEGER NOT NULL DEFAULT 0,
    UID TEXT,
    CONSTRAINT CT_TagLink UNIQUE (TagID ASC, LinkID ASC, LinkTableID ASC),
    CONSTRAINT FK_TagID FOREIGN KEY(TagID) REFERENCES Tag (ID) ON DELETE CASCADE DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE Task (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    LinkID INTEGER NOT NULL,
    LinkTableID INT NOT NULL,
    Category INT NOT NULL DEFAULT 0,
    TaskPriority INT NOT NULL,
    CreateDate INT NOT NULL DEFAULT 0,
    DueDate INT NOT NULL,
    Complete BOOLEAN NOT NULL DEFAULT 0,
    SystemTask BOOLEAN NOT NULL DEFAULT 0,
    TaskText TEXT NOT NULL,
    UpdateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    SyncVersion INTEGER NOT NULL DEFAULT 0,
    UID TEXT
);
CREATE TABLE WebLink (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    LinkID INTEGER NOT NULL,
    LinkTableID INT NOT NULL,
    Title TEXT NULL,
    Url TEXT NULL,
    CreateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    UpdateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    SyncVersion INTEGER NOT NULL DEFAULT 0,
    UID TEXT
);
CREATE TABLE PersonExternal (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    PersonID INTEGER NOT NULL,
    ProviderID INT NOT NULL,
    ExternalID TEXT NOT NULL,
    Status TEXT,
    CreateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    UpdateDate DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    SyncVersion INTEGER NOT NULL DEFAULT 0,
    UID TEXT,
    CONSTRAINT FK_PersonExternal_PersonID FOREIGN KEY(PersonID) REFERENCES Person (ID) ON DELETE CASCADE DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE ChangeMacroCommand (
    ID INTEGER PRIMARY KEY NOT NULL,
    Title TEXT NOT NULL,
    Description TEXT NOT NULL,
    Date DATETIME NOT NULL DEFAULT (strftime('%s', 'now')),
    IsHidden BOOLEAN DEFAULT NULL,
	Owner INTEGER NULL,
	OwnerId INTEGER NULL,
	Type INTEGER NULL,
    UID TEXT,
	Deleted BOOLEAN DEFAULT NULL
);
CREATE TABLE ChangeCommand (
    ID INTEGER PRIMARY KEY NOT NULL,
    TableID INT NOT NULL,
    OldValues TEXT NULL,
    NewValues TEXT NULL,
    ChangeMacroCommandID INTEGER NOT NULL,
    OrderNumber INTEGER NOT NULL,
    UID TEXT,
    CONSTRAINT FK_ChangeCommand_ChangeMacroCommand FOREIGN KEY (ChangeMacroCommandID) REFERENCES ChangeMacroCommand(ID) DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE DynamicFilterItem (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    FilterID INTEGER,
    FilterJson TEXT,
    FilterSQL TEXT,
    OperationID INTEGER NOT NULL,
    IncludeID INTEGER,
    IncludeFilter INTEGER,
    OrderNum INTEGER,
    ParentItem INTEGER,
    UID TEXT,
    TableDependencyMask INTEGER,
    CONSTRAINT FK_DynamicFilterItem_FilterID FOREIGN KEY(FilterID) REFERENCES DynamicFilter (ID) ON DELETE CASCADE DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE DynamicFilter (
    ID INTEGER PRIMARY KEY AUTOINCREMENT,
    Name TEXT,
    Type INTEGER DEFAULT 0,
    RootPersonID INTEGER NULL,
	Colors TEXT NULL,
    IsFrozen BOOLEAN DEFAULT NULL,
    UID TEXT,
    ResultSetIsReady BOOLEAN DEFAULT 0
);
CREATE TABLE Watermark (
    ID INTEGER PRIMARY KEY NOT NULL,
    Name TEXT NOT NULL,
    Options TEXT NULL,
    SyncVersion INTEGER NOT NULL DEFAULT 0,
    UID TEXT
);
CREATE TABLE DnaMatch (
    ID INTEGER PRIMARY KEY NOT NULL,
    DnaFactID INTEGER NOT NULL,
    MatchKitID TEXT NOT NULL,
    MatchPersonName TEXT NOT NULL,
    Meiosis INT NOT NULL,
    Centimorgans REAL NOT NULL,
    SharedSegments INT NOT NULL,
    Confidence REAL NOT NULL,
    UserPhoto TEXT NULL,
    UID TEXT NULL,
    CONSTRAINT FK_DnaMatch_Fact FOREIGN KEY (DnaFactID) REFERENCES Fact(ID) DEFERRABLE INITIALLY DEFERRED
);
CREATE TABLE FamilySearchMatches (
   ID INTEGER PRIMARY KEY AUTOINCREMENT,
   PersonID INTEGER NOT NULL,
   FSPersonID TEXT NOT NULL,
   Status INTEGER DEFAULT 1,
   UID TEXT NULL
);
CREATE TABLE DynamicFilterResultSet(ID INTEGER PRIMARY KEY, DynamicFilterID INTEGER NOT NULL, PersonID INTEGER NOT NULL, ColorIndex INTEGER NOT NULL DEFAULT 0, UID TEXT, CONSTRAINT CT_DynamicFilterResultSet UNIQUE (DynamicFilterID ASC, PersonID ASC, ColorIndex ASC));
